pragma solidity ^0.8.0;

contract DoctorAppointment {
  uint public appointmentDuration = 30 minutes;
  uint public maxAppointmentsPerDay = 5;
  uint public appointmentFee = 0.1 ether;

  struct Appointment {
    bool booked;
    address patient;
    bool paid;
  }

  mapping(uint => mapping(uint => Appointment)) public appointments;

  function bookAppointment(uint day, uint timeSlot) public payable {
    require(day >= block.timestamp, "Cannot book appointment in the past");
    require(msg.value == appointmentFee, "Appointment fee is required");
    require(appointments[day][timeSlot].booked == false, "Appointment slot is already booked");
    require(timeSlot < (24 hours / appointmentDuration), "Invalid time slot");

    appointments[day][timeSlot].booked = true;
    appointments[day][timeSlot].patient = msg.sender;

    emit AppointmentBooked(day, timeSlot, msg.sender);
  }

  function cancelAppointment(uint day, uint timeSlot) public {
    require(appointments[day][timeSlot].patient == msg.sender, "You did not book this appointment");
    require(appointments[day][timeSlot].paid == false, "Appointment fee already paid");

    appointments[day][timeSlot].booked = false;
    appointments[day][timeSlot].patient = address(0);

    emit AppointmentCanceled(day, timeSlot, msg.sender);
  }

  function payAppointmentFee(uint day, uint timeSlot) public payable {
    require(appointments[day][timeSlot].patient == msg.sender, "You did not book this appointment");
    require(appointments[day][timeSlot].paid == false, "Appointment fee already paid");
    require(msg.value == appointmentFee, "Appointment fee is required");

    appointments[day][timeSlot].paid = true;

    emit AppointmentPaid(day, timeSlot, msg.sender);
  }

  event AppointmentBooked(uint day, uint timeSlot, address patient);
  event AppointmentCanceled(uint day, uint timeSlot, address patient);
  event AppointmentPaid(uint day, uint timeSlot, address patient);
}
